import React, { Component } from 'react';
import PropTypes from 'prop-types';

const ToolBoxCard = () => {
	return <a target="_blank" href="https://www.toolboxproject.io" className="toolbox display-card"></a>
}

const LessonBoxCard = () => {
	return <a target="_blank" href="https://amaclean2.github.io" className="lessonbox display-card"></a>
}

const DevfestCard = () => {
	return <a target="_blank" href="https://devfestsf.com" className="devfest display-card"></a>
}

class Projects extends Component {

	render() {
	    return (<div className="Projects">
	    	<ToolBoxCard />
	    	<LessonBoxCard />
	    	<DevfestCard />
	    </div>);
	}
}

Projects.propTypes = {
}

export default Projects;
